import React, { Component } from 'react'
import "./textkor.css";

export class IntroKor extends Component {
  render() {
    return (
        <div className='m-10'>
            <div className='text-xs font-light font-grotesk'>KOR</div>
            <div className='text-base'>Sep 2023 - Present</div>

        </div>
    )
  }
}

export default IntroKor
